  "id": 25,
  "post_text": "Let's be super clear here ladies and gents.\n\nPraying for someone does nothing except satisfy your sense of obligation, or combats your sense of helplessness. I'm not interested in curtailing your beliefs or how you express them. Have at it.\n\nHowever, consider this: if there's a chance you're not doing something tangible for someone else, because you feel you've already done something by praying for them, then you've achieved zero sum. You've gained some level of contentment, and they have lost whatever good deed (read: action) you might have done instead.\n\nCare for people. Care for those you know, and those you don't. Tell them you care. Often. But please don't send prayers, good vibes or warm fuzzies only as a replacement for doing something real.",
