  "id": 122,
  "post_text": "First, let me state that my husband has been a USPS letter carrier for almost 20 years. So, this issue is close to my heart.\n\nI feel compelled to share a few pieces of information that it seems that a lot of people do not know or understand.\n\n1) The USPS is not a business. It is a service, protected by the US constitution. To say it loses billions is the same as saying that our military loses billions or that public schools lose billions. It is NOT for profit.\n\n2) The USPS costs tax payers exactly $0.00 dollars. Unless you purchase postage to mail a letter or a package, it doesn’t cost you a dime!\n\n3) FedEx, UPS, or Amazon cannot do what the USPS does. Not even close. They do not have the manpower or infrastructure to deliver to EVERY SINGLE RESIDENCE IN AMERICA, SIX DAYS A WEEK. They just can’t.\n\nI am so proud of the hard work that my husband puts in every day to support our family. It hurts my heart when I read or hear people make ignorant or uneducated statements about the USPS. Especially, because as we all know, too many people believe everything they read on social media.\n\nSo, how can you help? Please share these facts the next time someone contradicts them. Please share the truth.\n\nThank you!!",
