  "post_text": "#PRESSNOTE BY THE STATE GOVT.\n\nShimla Dated 24th May, 2020\n\n#MovementOfStrandedPeople #ToContinue\n\nNo plan to seal State borders\n\nA news item is being circulated in the social media claiming that borders of the Himachal Pradesh would be sealed from 31st May, 2020 and the people coming from other parts of the country would be kept in institutional quarantine at borders.\n\nAn official spokesman of the state government said here today that this news is false, fabricated and devoid of facts.\n\nHe said that the State Government is committed for the safety of the people of the stranded in different parts of the country due to the lockdown in wake of Covid-19 pandemic.\n\nThe Spokesman said that there will be no sealing of borders of the State and movement of the people would continue but passes will however be required as per current practice for all inter-state movement of persons and vehicles.\n\nThe state government has urged the people not to trust such fake news and there is no need of panic as the State has no such plans.",
