  "post_text": "Quick lesson about autoimmune diseases and COVID-19. Auto-Immune disease causes the white blood cells that normally protect your body from invaders to turn around and attack your cells, tissues and organs. Chronic fatigue is another symptom. It is not a cold or the flu, you will never get better, and even a nap will not help. Just eating a salad and hitting the gym won’t slim your face or get the pounds off. Sleeping 10 hours doesn’t leave you well rested, ever. The last minute changes in plans because that “just got ran over” feeling never makes appointments, it just walks in whenever you aren’t ready. Painful joints, muscles and bones, dry skin, breaking hair, hair loss, mood swings, and depression are just the tip of the iceberg.\nYou are also prone to having multiple autoimmune diseases, they typically come in pairs of two. You easily catch viral and bacterial infections. You have days where no matter how hard you try, you just can’t smile for anyone.\nI urge you to think twice before passing judgment and thinking our nation is overreacting to the extra measures being taken to curb the spread of this virus. YOU might be able to recover from it no problem however, carry it to SOMEONE WITH AN AUTOIMMUNE DISEASE and that individual won’t be as lucky.\nI am watching the ones who will take the time to read this entire post and react. Please, in honor of someone who is fighting Severe Asthma, Addison’s disease, Endometriosis, M.E, Rheumatoid Arthritis, POTS, sarcoidosis, MCAD, Sjogren's, Scleroderma, Hashimoto Disease, Ankylosing Spondylitis, Fibromyalgia, Myasthenia Gravis, Lupus, Sarcoidosis, Hepatitis, Raynauld's Syndrome, Diabetes, Mold Illness, Celiac, CROHN’S, Ulcerative Colitis, Pemphigus, SPS, MS, PBC, Psoriatic Arthritis, CIDP, MMN, GPA , CRPS and every other autoimmune disease, copy and paste to your page and reply \"DONE\" on mine.",
