  "post_text": "Good Morning Everyone\n\nA long pending update from me :\n\n*Yellowfashion.in* (our direct to consumer – online ethnic fashion brand)\n\nA journey which Me and Pallavi co-founded and started 10 years back in 2011 has come to a important milestone.\n\nWe have exited the business last month and a new team and management has taken over the business.\n\n-\\-\\- and -\\-\\-\n\n*Indore.Online* (our new venture in food)\nWe all love Indore’s food and most often people who move out of Indore – miss them the most.\n\nHere is our new initiative (which Pallavi is driving) – where we are bringing in Indore’s famous brands, products to your doorstep.\n\nOur first flagship retail store has opened in Thakur Village, Mumbai and we are also available in few pickup stores across Mumbai and online on www.Indore.Online.\n\nAs we start adding more retail pickup-stores, more brands and more products – we all would need a lot of support and wishes for this journey upwards & onwards.\n\nFor Free Shipping use code : bestwishes-Darshanandpallavi",
